import "./Home.css";
import About from "../About/About"
import $ from "jquery";


export default function Home() {
  let ProjectOffset = $("#projects").offset().top;
  console.log(ProjectOffset);
  $(window).scrollTop(() => {
    let Wscroll = $(window).scrollTop();
    if (Wscroll > ProjectOffset.top) {
      $("#nav").css("background", "red");
    }
  });
  return (
    <div className="Home">
        <About/>
    </div>
  );
}
